広告文責/販売会社:株式会社Hanbit TEL:050-1040-7307<br><br><br><br><font color="#BF0000"><b>■サイズ・色違い・関連商品</b></font><hr color="#BF0000"><br><b>トイプードル  </b><br><b>ミニチェアダックス  </b><br><b>しば  </b><br><br><b>関連商品の検索結果一覧はこちら</b><br><br><br><font color="#BF0000"><b>■商品内容</b></font><hr color="#BF0000"><br>　犬は好きだが家で飼えない方のために、犬の代理として<br>　作りました。撫でると鳴く、呼べば答えるワンちゃんです。<br><br>　■ご要望の多かった犬をついに商品化<br>　　人気の犬種　（ミニチュアダックス・しば・トイプー）<br>　■撫でると鳴くセンサー　3ケ所<br>　　頭・背中・尻尾に静電センサーを配置<br>　　撫でると触るの違いを検知して、鳴き声を変えます。<br>　■呼べばワンと答える機能を新たに追加<br>　　高性能の音センサーを搭載しました。<br>　■大きさも猫ちゃん対比１．２倍<br>　　ボリューム感も大幅にUP！子犬らしい大きさです。<br><br><br>「なでなでワンちゃん」は、犬のぬいぐるみの内部に、<br>スマートホンのパネルに活用されている、静電センサーを<br>頭、背中・尻尾の3か所に配置しました。今までの<br>スイッチとは違い、撫でると触るの違いを感知して、鳴き声を<br>変えます。本物の犬の声を録音していて、犬を飼っている、<br>気持ちになります。<br>又、新たに音センサーも内蔵呼べば答える新機能も追加<br>頭センサー　撫でられると「ワン」「ワーン」「ハアハア」等６種類の声で鳴きます<br>背中センサー撫でられると「クゥーン」「クン」「キャーン」等６種類の声で鳴きます<br>尻尾センサー撫でられると「クィーン」「キャン」等６種類の声で鳴きます<br>音センサー呼べば答える「ワン」など４種類の声で鳴きます<br>＊ＳＰモードとしてたまに「ウォーン」といった遠吠えの声で鳴きます<br>＊音量ボリュームは２段階：頭と背中を同時に触ると調整できます<br><br><br><br><font color="#BF0000"><b>■商品スペック</b></font><hr color="#BF0000"><br>なでなでワンちゃん<br>原産国 中国<br>安全基準 ST<br>主な素材 ポリエステル・ABS<br>商品サイズ Ｗ330 ×Ｈ 140 ×Ｄ 220<br>パッケージサイズ Ｗ 305×Ｈ117 ×Ｄ 160<br>電　池 ／電池寿命 単4アルカリ乾電池×2本 （別売） 連続8時間<br>カートン入数 単品　１２個　<br>セット内容　・なでなでワンちゃん　本体　1個<br>・説明書　１枚　カラー<br>・段ボールパッケージ　１色印刷　・ビニール袋<br>（電池は別売りです。）<br><br><br><br><br><br><font color="#BF0000"><b>■送料・配送についての注意事項</b></font><hr color="#BF0000"><br>●本商品の出荷目安は<b>【1 - 7営業日　※土日・祝除く】</b>となります。<br><br>●お取り寄せ商品のため、稀にご注文入れ違い等により欠品・遅延となる場合がございます。<br><br>●本商品は同梱区分<b>【TS2016】</b>です。同梱区分が<b>【TS2016】</b>と記載されていない他商品と同時に購入された場合、梱包や配送が分かれます。<br><br>●沖縄、離島および一部地域への配送時に追加送料がかかる場合がございます。<style type="text/css">
